<script setup lang="ts">
import useSpringApi from '~/composables/useSpringApi';

import jsPDF from 'jspdf';
import 'jspdf-autotable';

    // get value for path image from env
    const config = useRuntimeConfig();
    const SPRINGAPI_IMAGE = config.public.urlImage;

    // create variable for save data into products variable
    const products:any = ref([])

     // สร้างตัวแปรไว้สำหรับ Filter ข้อมูล Products
    const filteredProducts: any = ref([]);

    // ตัวแปรสำหรับเก็บค่าการค้นหาและหมวดหมู่ที่เลือก
    const search = ref("");
    const selectedCategory = ref("");

    // 
    const page = ref(1); // first page want to display
    const rowPerPage = ref(5) // list amount
    const totalItem = ref() // all list

    // format Date function
    const formatDate = (dateString: string) => {
        const options: Intl.DateTimeFormatOptions = { year: 'numeric', month: 'long', day: 'numeric' }
        return new Date(dateString).toLocaleDateString(undefined, options)
    }

    // format money number
    const numberWithCommas = (x: number | null | undefined) => {
        if (x === undefined || x === null){
            return '';
        }
        return x.toString().replace(/\B(?=(\d{3})+(?!\d))/g,",");
    }

    // ----------------- Export to CSV ---------------------
    const exportCSV = () => {
        const csvRow: string[] = []
        const header = ["ID", "Product", "Category", "Price", "Unit", "Created"]
        csvRow.push(header.join(','))

        products.value.map((product: any, index: number) => {
            const row = [
            index + 1,
            `"${product.productName.replace(/"/g, '""')}"`, // Handle quotes
            `"${product.categoryName.replace(/"/g, '""')}"`,
            numberWithCommas(product.unitPrice),
            product.unitStock,
            formatDate(product.createDate)
            ]
            csvRow.push(row.join(','))
        })

        const csvString = csvRow.join('\n')
        const BOM = '\uFEFF' // UTF-8 Byte Order Mark
        const blob = new Blob([BOM + csvString], { type: 'text/csv;charset=utf-8;' }) // Include BOM for UTF-8

        const a = document.createElement("a")
        a.href = URL.createObjectURL(blob)
        a.setAttribute("download", `products-${new Date().toISOString()}.csv`)
        document.body.appendChild(a)
        a.click()
        document.body.removeChild(a)
    }
    // -----------------------------------------------------

    // ----------------- Export to PDF ---------------------
    const exportPDF = (products: any[]) => {
        const unit = "pt";
        const size = "A4"; // ใช้ A3, A4, A5 ฯลฯ
        const orientation = "portrait";  // portrait หรือ landscape
        const marginLeft = 40;

        const font:any = '';

        var callAddFont = function (this: any) {
            this.addFileToVFS('Kanit-Regular-normal.ttf', font)
            this.addFont('Kanit-Regular-normal.ttf', 'Kanit-Regular', 'normal')
        }
        jsPDF.API.events.push(['addFonts', callAddFont])

        // New PDF instance
        const doc:any = new jsPDF(orientation, unit, size)
        // Set font
        doc.setFont('Kanit-Regular')
        // ตั้งค่าขนาดฟอนต์
        doc.setFontSize(14)
        // ตั้งค่าชื่อเอกสารพร้อมวันที่
        const title = `รายงานสินค้า - ${new Date().toLocaleDateString()}`

        // ตั้งค่าหัวตาราง
        const headers = [
            [
            "#",
            "Product",
            "Category",
            "Price",
            "Unit",
            "Created"
            ]
        ]
        // ตั้งค่าข้อมูลในตาราง
        const data = products.map((product, index) => [
            index + 1,
            product.productName,
            product.categoryName,
            `$${numberWithCommas(product.unitPrice)}`,
            product.unitStock,
            formatDate(product.createDate)
        ])
        // ตั้งค่าตาราง
        doc.autoTable({
            head: headers,
            body: data,
            startY: 60,
            theme: "grid",
            margin: { top: 60, right: 40, bottom: 20, left: 40 },
            styles: { fontSize: 10, cellPadding: 5 }, // ขนาดฟอนต์และ padding ของเซลล์
            columnStyles: {
                0: { cellWidth: 30 },
                1: { cellWidth: 'auto' },
                2: { cellWidth: 100 },
                3: { cellWidth: 80 },
                4: { cellWidth: 40 },
                5: { cellWidth: 80 }
            },
        })
        // ตั้งค่าชื่อเอกสาร
        doc.text(title, marginLeft, 40)
        // ตั้งค่าหมายเลขหน้า
        const totalPages = doc.internal.getNumberOfPages()
        for (let i = 1; i <= totalPages; i++) {
            doc.setPage(i)
            doc.text(`Page ${i} of ${totalPages}`, 500, 800)
        }
        // ชื่อไฟล์ PDF พร้อมวันเวลาที่สร้าง
        const pdfName = `products-report-${new Date().toISOString()}.pdf`
        // บันทึกไฟล์ PDF
        doc.save(pdfName)
    }
    // -----------------------------------------------------

    // require product api
    //function for fetch product
    // ฟังก์ชันสำหรับการ Fetch Products ทั้งหมด
    const fetchProducts = async () => {
        console.log("Fetching products with category:", selectedCategory.value)
        const { data } = await useSpringApi().getAllProducts(
            page.value, 
            rowPerPage.value, 
            search.value, 
            selectedCategory.value ? parseInt(selectedCategory.value) : null
        )

        // นำข้อมูลที่ได้ไปเก็บไว้ในตัวแปร products
        products.value = data.value?.products
        totalItem.value = data.value?.total
        filteredProducts.value = products.value
        console.log(data.value)
    }

    // ฟังก์ชันสำหรับการ Fetch Categories ทั้งหมด
    const fetchCategory = async () => {
        try {
            const { data } = await useSpringApi().getAllCategories()
            categoryList.value = data.value || []
            console.log('Category List:', categoryList.value)
        } catch (error) {
            console.error('Error fetching categories:', error)
        }
    }

    // ----------------- Dialog ---------------------------
    const dialog = ref(false)
    const deletedialog = ref(false)
    const editedIndex = ref(-1)
    const deleteIndex = ref(-1)

    // Close Dialog
    function close() {
        dialog.value = false
        deletedialog.value = false
        setTimeout(() => {
        }, 300)
    }

    //Computed Property
    const formTitle = computed(() => {
        return editedIndex.value === -1 ? "Add New Product" : "Edit Product"
    })


    // Form data
    const productName = ref('')
    const unitPrice  = ref(0)
    const unitStock = ref(0)
    const image = ref<File | null>(null)
    const category = ref('')
    const categoryList = ref([] as any)

    // Reset Form
    const resetForm = () => {
        productName.value = ''
        image.value = null
        files.value = []
        unitPrice.value = 0
        unitStock.value = 0
        category.value = ''
        imageUrl.value = null
    }

    // for image preview =================
    const files: any = ref([])
    const imageUrl = ref<string | null>(null)
    // handle image change
    const handleFileChange = async (e: any) => {
        const file = (e.target as HTMLInputElement).files?.[0]
        const reader = new FileReader()
        reader.onload = (e) => {
        imageUrl.value = e.target?.result as string
        }
        reader.readAsDataURL(file!)
        image.value = files.value[0]
    }
    // remove image
    const removeImage = () => {
        imageUrl.value = null
    }

    // ----------------- Form Validation ----------------
    const nameRules = [
        (v: string) => !!v || "Product name is required",
        (v: string) => (v && v.length >= 5) || "Product name be at least 5 characters",
    ]
    const priceRules = ref([
        (v: string) => !!v || "Price is required",
    ])
    const qtyRules = ref([
        (v: string) => !!v || "Unit in stock is required",
    ])
    const categoryRules = ref([
        (v: string) => !!v || "Category is required",
    ])

    // ---------------------- Filter Products ------------------------------
    // const filterProducts = () => {
    //     console.log("filterProducts called with category:", category.value)
    //     page.value = 1;
    //     fetchProducts();
    // }

    // const resetSearch = () => {
    //     search.value = "";
    //     filterProducts();
    // }

    const filterProducts = () => {
        console.log("filterProducts called with category:", category.value)
        page.value = 1; // กำหนดหน้าแรกเป็นหน้าที่ 1
        fetchProducts()
    }
    const resetSearch = () => {
        search.value = ''  // รีเซ็ตค่าของ search
        filterProducts()  // เรียกฟังก์ชันเพื่อรีเฟรชข้อมูล
    }

    // ----------------- Submit Add Product Form ----------------
    const formAddSubmit = async () => {
        // check form validate
        if(!productName.value || !unitPrice.value || !unitStock.value || !category.value){
            return
        }else{
            // form data
            const formData: any = new FormData();

            formData.append('productName', productName.value)
            formData.append('unitPrice', unitPrice.value)
            formData.append('unitInStock', unitStock.value)
            formData.append('categoryId', category.value)
            // Check if image is selected
            if (image.value) {
                formData.append('image', image.value);
            }
            // Debugging formData entries
            for (var pair of formData.entries()) {
                console.log(pair[0] + ', ' + pair[1]);
            }

            try{
                // call APIs
                await useSpringApi().createProduct(formData)

                // Reset form
                resetForm()

                // Close Dialog
                close()

                // Fetch products
                fetchProducts()
            }catch (error){
                console.error('Error creating product:', error)
            } 
        }
    }

    // get product by Id
    const editProduct = async (id: number) => {
        // call APIs get product by id
        const { data: product } = await useSpringApi().getProductById(id)

        // set form data
        productName.value = product.value?.productName
        unitPrice.value = product.value?.unitPrice
        unitStock.value = product.value?.unitStock
        category.value = product.value?.categoryId
        
        //check if product has image
        if (product.value?.productPicture){
            imageUrl.value = `${SPRINGAPI_IMAGE}/${product.value?.productPicture}`
        }else{
            imageUrl.value = null
        }

        // set the edited index and open the form
        editedIndex.value = id
    }

    // ----------------- Submit Edit Product Form ----------------
    const formEditSubmit = async () => {

        // check form validation
        if (!productName.value || !unitPrice.value || !unitStock.value || !category.value) {
            return null;
        } else {

    // Form data
    const formData: any = new FormData()

    formData.append('productName', productName.value)
    formData.append('unitPrice', unitPrice.value)
    formData.append('unitInStock', unitStock.value)
    formData.append('categoryId', category.value)

    // Check if image is selected
    if (image.value) {
        formData.append('image', image.value);
    }

    // Debugging formData entries
    for (var pair of formData.entries()) {
        console.log(pair[0] + ', ' + pair[1]);
    }

    try {
        // Call API Update Product
        await useSpringApi().updateProduct(editedIndex.value, formData)

        // Reset Form
        resetForm()

        // Close Dialog
        close()

        // Refresh Product List with current page
        const { data: newProducts } = await useSpringApi().getAllProducts(page.value, rowPerPage.value)
        products.value = newProducts.value?.products

    } catch (error) {
        console.error('Error updating product:', error)
    }

}

}

    // ----------------- Delete Product --------------------------
    const deleteProduct = async (id: number) => {
        // Call API Delete Product
        await useSpringApi().deleteProductById(id)
        // Close Dialog
       close()
        // Refresh Product List with current page
        const { data: newProducts } = await useSpringApi().getAllProducts(page.value, rowPerPage.value)
        products.value = newProducts.value?.products
    }

    //require function frist time component load
    onMounted(() => {
        fetchProducts()
        fetchCategory()
        // resetSearch()
    })

    // console.log(prodcuts)

    definePageMeta({
        layout: "backend",
    })

    useHead({
        title:'Prodocut',
        meta: [
            {
                name: 'description',
                content: 'Product page'
            }
        ]
    })
</script>

<template>

    <!-- Add / Edit Product Dialog -->
    <v-dialog v-model="dialog" width="800">
        <v-card>

            <v-card-title class="pa-4 bg-secondary">
                <span class="title text-white">{{ formTitle }}</span>
            </v-card-title>

            <v-card-text>
                <v-container>
                <v-form fast-fail ref="form" @submit.prevent="editedIndex === -1 ? formAddSubmit(): formEditSubmit()">
                    <v-row>

                    <v-col cols="12" sm="6">
                        <v-col cols="12" sm="12">
                        <v-text-field
                            v-model="productName"
                            :rules="nameRules"
                            label="Product Name"
                            hide-details="auto"
                            variant="outlined"
                        ></v-text-field> 
                        </v-col>
                        <v-col cols="12" sm="12">
                        <v-text-field
                            v-model="unitPrice"
                            :rules="priceRules"
                            label="Price"
                            hide-details="auto"
                            variant="outlined"
                            type="number"
                        ></v-text-field>
                        </v-col>

                        <v-col cols="12" sm="12">
                        <v-text-field
                            v-model="unitStock"
                            :rules="qtyRules"
                            label="Unit in Stock"
                            hide-details="auto"
                            variant="outlined"
                            type="number"
                        ></v-text-field>
                        </v-col>

                        <v-col cols="12" sm="12">
                            <v-select
                                v-model="category"
                                :rules="categoryRules"
                                :items="categoryList"
                                item-title="categoryName"
                                item-value="id"
                                label="Category"
                                hide-details="auto"
                                variant="outlined"
                            ></v-select>
                        </v-col>
                    </v-col>

                    <v-col cols="12" sm="6">
                    
                        <v-col cols="12" sm="12">
                        <!-- Preview Image -->
                        <v-img v-if="imageUrl" :src="imageUrl" class="img-prview">
                            <v-btn icon @click="removeImage">
                            <v-icon>mdi-close</v-icon>
                            </v-btn>
                        </v-img>

                        <!-- Image Inputs -->
                        <v-file-input
                            @change="handleFileChange"
                            v-model="files"
                            label="Image"
                            hide-details="auto"
                            outlined
                            dense
                            prepend-icon="mdi-image"
                            accept="image/*"
                        ></v-file-input>
                        </v-col>
                    </v-col>

                    </v-row>
                    
                    <v-row justify="center">
                        <!-- Button Submit -->
                        <v-card-actions class="pl-3">
                        <v-btn
                            color="secondary"
                            size="large"
                            variant="elevated"
                            type="submit"
                            >Submit</v-btn
                        >
                        <v-btn color="error" size="large" @click="close">Cancel</v-btn> 
                        </v-card-actions>
                    </v-row>

                </v-form>
                </v-container>
            </v-card-text>

        </v-card>
    </v-dialog>

    <!-- Confirm Delete Dialog -->
    <v-dialog
        v-model="deletedialog"
        width="auto"
    >
        <v-card>
        <v-card-title class="text-h6 mx-3 mt-3">
            Confirm delete product Id: {{ deleteIndex }} ?
        </v-card-title>
        <v-card-actions class="pb-4">
            <v-spacer></v-spacer>
            <v-btn
            color="red-darken-1"
            class="text-button"
            variant="text"
            @click="deleteProduct(deleteIndex)"
            >
            Delete
            </v-btn>
            <v-btn
            color="grey-darken-1"
            class="text-button"
            variant="text"
            @click="deletedialog=false"
            >
            Cancle
            </v-btn>
        </v-card-actions>
        </v-card>
    </v-dialog>

    <v-row>
        <v-col cols="12" sm="12">
            <v-card>
                <v-card-text class="pa-5">
                    <v-row>
                        <v-col cols="12" lg="2" md="2">
                            <h2>Product ({{ totalItem }})</h2>
                        </v-col>
                        <v-col cols="12" lg="3" md="3">
                            <v-select 
                                v-model="selectedCategory"
                                :items="categoryList"
                                item-title="categoryName"
                                item-value="id"
                                label="Category"
                                hide-details="auto"
                                variant="outlined"
                                clearable
                                @update:modelValue="filterProducts"
                           ></v-select>
                        </v-col>
                        <v-col cols="12" lg="3" md="3">
                           <v-text-field
                                v-model="search"
                                density="default"
                                label="Search Products"
                                hide-details="auto"
                                variant="outlined"
                                clearable
                                @keyup.enter="filterProducts"
                                @click:clear="resetSearch"
                           >

                           </v-text-field>
                        </v-col>
                        <v-col cols="12" lg="4" md="4" class="text-right">
                            <v-btn
                                color="primary"
                                class="ml-auto"
                                variant="elevated"
                                @click="dialog=true;editedIndex=-1;resetForm()"
                            >
                            Add Product
                            </v-btn>
                            <v-btn
                                color="secondary"
                                class="ml-2"
                                variant="elevated"
                                @click="exportPDF(products)"
                            >
                                Export PDF
                            </v-btn>
                            <v-btn
                                color="success"
                                class="ml-2"
                                variant="elevated"
                                @click="exportCSV"
                            >
                                Export CSV
                            </v-btn>
                        </v-col>
                    </v-row>

                    <div>&nbsp;</div>

                    <v-pagination
                        v-model="page"
                        :length="Math.ceil(totalItem / rowPerPage)"
                        next-icon="mdi-chevron-right"
                        prev-icon="mdi-chevron-left"
                        @next="fetchProducts"
                        @prev="fetchProducts"
                        @update:model-value="fetchProducts"
                    ></v-pagination>

                    <v-table class="mt-5">
                        <thead>
                            <tr>
                                <th>Id</th>
                                <th>Product Info</th>
                                <th>Price</th>
                                <th>Qty</th>
                                <th>Category</th>
                                <th>Created</th>
                                <th>Action</th>
                            </tr>
                        </thead>
                        <tbody>
                            <tr v-for="product in products" :key="products.id">
                                <td>{{ product.id }}</td>
                                <td>
                                    <div class="d-flex align-center py-4">
                                        <div v-if="product.productPicture">
                                            <v-img
                                                :src = "`${SPRINGAPI_IMAGE}/${product.productPicture}`"
                                                width="50px"
                                                class="img-fluid"
                                            ></v-img>
                                        </div>
                                        <div v-else-if="product.productPicture.value == 'noimg.jpg' || !product.productPicture">
                                            <v-icon size="60">mdi-image</v-icon>
                                        </div>
                                        <div class="ml-5">
                                            <h4 class="my-2">
                                                {{ product.productName }}
                                            </h4>
                                        </div>
                                    </div>
                                </td>
                                <td>{{ product.unitPrice }}</td>
                                <td>{{ product.unitStock }}</td>
                                <td>{{ product.categoryName }}</td>
                                <td>{{ product.createDate }}</td>
                                
                                <td>
                                    <v-icon
                                        small
                                        class="mr-2 text-info cursor-pointer"
                                        title="Edit"
                                        @click="dialog=true;editedIndex=1;editProduct(product.id)"
                                    >mdi-pencil</v-icon>
                                    <v-icon
                                        small
                                        class="mr-2 text-error cursor-pointer"
                                        title="Delete"
                                        @click="deletedialog=true; deleteIndex=product.id"
                                    >mdi-delete</v-icon>
                                </td>
                            </tr>
                        </tbody>
                    </v-table>
                </v-card-text>
            </v-card>
        </v-col>
    </v-row>
</template>

